import { TextField } from '@material-ui/core'
import Autocomplete from '@material-ui/lab/Autocomplete';
import React from 'react'
import { IAutocompleteItem } from '../../_interfaces/IAutocompleteItem';
import InputTextField from './InputTextField';

interface IProps{
    items: IAutocompleteItem[]
    filterText: string
    handleFilterText: (txt: string) => void
}

const AutocompleteInput: React.FC<IProps> = (props) =>{

    const {items, filterText, handleFilterText} = props

    return(
        <Autocomplete
            options={items}
            noOptionsText="???"
            getOptionLabel={(x) => x.label}
            renderInput={(params) => <InputTextField value={filterText} label='Filter' onValueChange={handleFilterText} />}
            />
    )
}

export default AutocompleteInput
